import React from "react";
import "./InitialForm.css";

var today = new Date();

export default function InitialForm() {
    return(
        <div className="initialForm">
            <h1> Tell us about you.</h1>
            <form>
                <label>Gender:</label>
                <input
                    type="button"
                    required
                />
                <input
                    type="button"
                    required
                />
                <label>Date of birth</label>
                <input
                    type="number"
                    required
                    min={1}
                    max={12}
                />
                <input
                    type="number"
                    required
                    min={1}
                    max={31}
                />
                <input
                    type="number"
                    required
                    min={1900}
                    max={today.getFullYear() - 18}
                />

            </form>
        </div>
    );
}
